import Link from 'next/link'


const linkStyle = {
  marginRight: 15,
  fontSize: 20
}

export default function TvMazeHeader() {
  return (
    <div>
      <Link href="/tvpage">
        <a style={linkStyle}>Search Page</a>
      </Link>
    </div>
  )
}
